import React from "react";
import "./index.css";
import "./Cart.css";

function Cart() {
  return (
    <div className="outer">
      <div className="cart shadow-lg shadow-black">
        <h1 className="font-bold text-5xl text-center mt-2">Cart</h1>
        <div className="add"></div>
        <div className="accounts">
          <div className="coup text-center">
            <p>Apply Coupon</p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Cart;
